import React from 'react';

const User = props => {

  const user = props.users.users.select((user, id) => {
    return <li key={id}>{user.username}</li>;
  });

  return (
    <div className="viewable">
      <h2>Good Luck {this.props.username}!</h2>
      <p className="cash">&#128181;</p>
    </div>
  );
};

export default User;



